import React from 'react';

const IdintetyList = (props) => {
  return (
    <ul>
      {props.idintetyInfo.map((info) => (
        <div>
          <li>{info.Name}</li> <li>{info.Age}</li> <li>{info.Hobby}</li>
        </div>
      ))}
    </ul>
  );
};

export default IdintetyList;
